import React from 'react';
import style from './footer.module.css';
import { Link } from 'react-router-dom';

const Footer = () => {
    return(
        <div className={style.footer}>
            <Link to="/" className={style.logo}>

            </Link>
        </div>
    )
}

export default Footer;
